import 'chart.js';
import React from 'react';
import { Line } from 'react-chartjs-2';
import ReactDOM from 'react-dom'; // Fixed typo in import

function LineChart() {
  const data = {
    labels: ["January", "February", "March", "April", "May", "June"],
    datasets: [ // Changed 'dataset' to 'datasets'
      {
        label: 'Ritik',
        data: [2, 4, 5, 6, 1, 9],
        fill: true,
      },
      {
        label: 'Nikhil',
        data: [8, 3, 1, 6, 2, 9],
        fill: true,
      }
    ]
  };

  const options = {
    scales: {
      y: {
        beginAtZero: false,
      },
      x: {
        beginAtZero: false,
      }
    },
    plugins: {
      legend: {
        display: true,
        position: 'top',
      },
      tooltip: {
        enabled: true,
      },
    }
  };

  return <Line data={data} options={options}></Line>;
}

export default LineChart;
